import React from "react";

const Contact = () => {
  return (
    <div id="contact" style={{ padding: "40px", backgroundColor: "#e6e6e6" }}>
      <h2>Contact</h2>
      <p>
        <strong>Address:</strong> Vasavi College of Engineering, Hyderabad, India <br />
        <strong>Email:</strong> info@vasavicollege.edu <br />
        <strong>Phone:</strong> +91 12345 67890
      </p>
    </div>
  );
};

export default Contact;
